import React from "react";
import { Button, Grid } from "@mui/material";
import AddIcon from '@mui/icons-material/Add';
import { useDispatch } from "react-redux";
import { setShowModal } from "../../Reducers/DayReducer";
import { useSelector } from "react-redux";
import DayModal from "./DayModal";
import DayDragDrop from "./DayDragDrop";

const Day = () => {
    const dispatch = useDispatch();
    const showModal = useSelector(state => state.dayReducer.showModal);
    const priorityLevel = useSelector(state => state.dayReducer.priorityLevel);
    const titleFieldValue = useSelector(state => state.dayReducer.titleFieldValue);
    const descriptionFieldValue = useSelector(state => state.dayReducer.descriptionFieldValue);
    const tasks = useSelector(state => state.dayReducer.tasks)

    const openModal = () => {
        dispatch(setShowModal(true));
    };

    const onDragEnd = (result) => {
        const {source, destination} = result

        if (!result) {
            return
        }

        if (source.droppableId == destination.droppableId && source.index == destination.index) {
            return
        }

        source.droppableId = destination.droppableId
        console.log(source)
    };

    return (
        <>
            <Button
                variant='contained'
                sx={{
                    borderRadius: 5,
                    position: 'absolute',
                    top: '5%',
                    right: '10%'
                }}
                onClick={() => {openModal()}}
            >
                <AddIcon />
            </Button>
            <Button
                variant='contained'
                sx={{
                    borderRadius: 5,
                    position: 'absolute',
                    top: '5%',
                    right: '20%'
                }}
                onClick={() => {openModal()}}
            >
                <AddIcon />
            </Button>
            <DayModal 
                title={'Add new task'}
                showModal={showModal}
            />
            <DayDragDrop />
        </>
    );
}

export default Day;
